In een wereld waar cybercriminaliteit op globale schaal plaatsvindt
volgen we een veroordeelde gevangene en zijn Amerikaanse en Chinese handlangers
in een netwerk van Chicago tot Los Angeles en van Hongkong tot Jakarta.
De Amerikaanse en Chinese hackers zullen samen moeten werken
om een grote computerinbraak te stoppen.

Storyline

Nick Hathaway, an extremely talented hacker who has gone astray, finds his way out 
of a 15 year prison sentence when parts of a computer code he once wrote during his 
youth appears in a malware that triggered a terrorist attack in factory in China. 
This opportunity will reunite him with an old friend but will also put him in the 
middle of a power game between the American and Chinese government as well as 
arch villain hacker whose identity he has to find if he wants to keep his freedom and his life. 

